import React from 'react';
import {useState, useEffect } from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Home from './components/pages/Home';
import Cards from './components/Cards';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Axios from "axios";

function App() {

  const titleArr = [];
  const priceArr = [];
  const ageArr = [];
  const pDateArr = [];




  useEffect(() => {
    Axios.get('http://localhost:5000/api/get').then((response) => {
      response.data.map((bookTitle)=>{
        titleArr.push(bookTitle.title);
      })

      response.data.map((ageRange)=>{
        ageArr.push(ageRange.age);
      })

      response.data.map((dateP)=>{
        pDateArr.push(dateP.publication_date);
      })

      response.data.map((priceOf)=>{
        priceArr.push(priceOf.price);
      })

      console.log(titleArr);
      console.log(ageArr);
      console.log(pDateArr);
      console.log(priceArr);

    }).catch(error => {
      console.log(error.response)
    });

  }, [])
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home />} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
